DROP TABLE IF EXISTS `iwater_orders`;
CREATE TABLE `iwater_orders` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `client_id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL,
  `contact` varchar(255) NOT NULL,
  `date` varchar(20) default NULL,
  `no_date` tinyint(4) NOT NULL,
  `time` varchar(255) NOT NULL,
  `period` varchar(50) NOT NULL,
  `notice` text,
  `water_ag` int(11) default NULL,
  `water_dp` int(11) default NULL,
  `water_e` int(11) default NULL,
  `water_pl` int(11) default NULL,
  `water_other` int(11) default NULL,
  `water_total` int(11) NOT NULL,
  `equip` text,
  `dep` varchar(255) default NULL,
  `cash` varchar(15) NOT NULL,
  `cash_b` varchar(15) default NULL,
  `on_floor` varchar(15) default NULL,
  `tank_b` int(11) default NULL,
  `tank_empty_now` int(11) NOT NULL default '0',
  `driver` int(11) NOT NULL,
  `status` tinyint(4) NOT NULL,
  `reason` varchar(255) default NULL,
  `map_num` int(11) default NULL,
  `region` varchar(255) NOT NULL,
  `list` int(11) default NULL,
  `coords` varchar(255) default NULL,
  `history` varchar(255) NOT NULL,
  `changed_driver` int(2) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=999 DEFAULT CHARSET=utf8;

